import React from "react";
import Component from "./Component";
import web from "./images/ujjwal.jpg"
function About() {
  return (
    <>
     <Component text="Welcome To About Page" imgsrc={web} visit="/contact" btname="Contact Now"/>
    </>
  );
}

export default About;
